import React from 'react'
import { Link } from 'react-router-dom'
const PaymentForm = ({previousStep}) => {
  return (
    <div>
      <h1>PAyment Form</h1>
      <Button onClick={()=>previousStep} ><Link to='/AddressForm' >Pervious Step</Link></Button>
    </div>
  )
}

export default PaymentForm
